import { motion, useAnimationControls } from 'framer-motion';
import { useState, useEffect } from 'react';

export const BlobDemo = () => {
  const [isActive, setIsActive] = useState(false);
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const [audioContext, setAudioContext] = useState(null);
  const controls = useAnimationControls();

  // Initialize audio context for sound effects
  useEffect(() => {
    setAudioContext(new (window.AudioContext || window.webkitAudioContext)());
  }, []);

  const playPop = () => {
    if (audioContext) {
      const oscillator = audioContext.createOscillator();
      const gainNode = audioContext.createGain();
      oscillator.connect(gainNode);
      gainNode.connect(audioContext.destination);
      oscillator.frequency.setValueAtTime(440, audioContext.currentTime);
      gainNode.gain.setValueAtTime(0.1, audioContext.currentTime);
      oscillator.start();
      oscillator.stop(audioContext.currentTime + 0.1);
    }
  };

  return (
    <div className="min-h-screen bg-black flex flex-wrap gap-8 justify-center items-center p-8">
      {/* Psychedelic Blob */}
      <motion.div
        className="w-64 h-64 relative group cursor-pointer"
        whileHover={{ scale: 1.1 }}
        onClick={() => {
          playPop();
          controls.start({
            rotate: [0, 360],
            scale: [1, 1.2, 1],
          });
        }}
      >
        {[...Array(5)].map((_, i) => (
          <motion.div
            key={i}
            className="absolute inset-0 bg-gradient-to-r from-purple-500 via-pink-500 to-red-500 rounded-[42%_58%_70%_30%] mix-blend-multiply"
            animate={{
              rotate: [0, 360],
              scale: [1, 1.1, 1],
              borderRadius: [
                "42% 58% 70% 30%",
                "30% 60% 70% 40%",
                "60% 40% 30% 70%",
              ],
            }}
            transition={{
              duration: 10 + i,
              repeat: Infinity,
              repeatType: "reverse",
              ease: "linear",
            }}
            style={{
              filter: `hue-rotate(${i * 45}deg)`,
              opacity: 0.7,
            }}
          />
        ))}
        <span className="absolute inset-0 flex items-center justify-center text-white font-bold text-lg z-10">
          Click Me!
        </span>
      </motion.div>

      {/* Interactive Particle Blob */}
      <motion.div
        className="w-64 h-64 bg-gradient-to-r from-cyan-500 to-blue-500 rounded-full relative overflow-hidden"
        onMouseMove={(e) => {
          const { currentTarget, clientX, clientY } = e;
          const { left, top } = currentTarget.getBoundingClientRect();
          setMousePosition({
            x: clientX - left,
            y: clientY - top,
          });
        }}
        whileHover="hover"
      >
        {[...Array(20)].map((_, i) => (
          <motion.div
            key={i}
            className="absolute w-2 h-2 bg-white rounded-full"
            variants={{
              hover: {
                x: mousePosition.x + Math.cos(i * Math.PI) * 100,
                y: mousePosition.y + Math.sin(i * Math.PI) * 100,
                scale: [1, 1.5, 1],
                opacity: [0.5, 1, 0.5],
              },
            }}
            transition={{
              duration: 2,
              repeat: Infinity,
              repeatType: "reverse",
              delay: i * 0.1,
            }}
            style={{
              left: '50%',
              top: '50%',
            }}
          />
        ))}
      </motion.div>

      {/* Morphing Chaos Button */}
      <motion.button
        className="relative w-64 h-64 bg-gradient-to-r from-green-500 to-yellow-500 overflow-hidden"
        onClick={() => setIsActive(!isActive)}
        animate={{
          borderRadius: isActive
            ? ["0% 100% 100% 0%", "100% 0% 0% 100%", "100% 100% 0% 0%"]
            : ["42% 58% 70% 30%", "30% 60% 70% 40%", "60% 40% 30% 70%"],
        }}
        transition={{
          duration: 2,
          repeat: Infinity,
          repeatType: "reverse",
        }}
      >
        {isActive && (
          <motion.div
            className="absolute inset-0 bg-gradient-to-r from-purple-500 to-pink-500"
            animate={{
              background: [
                "linear-gradient(0deg, #ec4899, #8b5cf6)",
                "linear-gradient(180deg, #3b82f6, #ec4899)",
                "linear-gradient(360deg, #8b5cf6, #3b82f6)",
              ],
            }}
            transition={{
              duration: 2,
              repeat: Infinity,
            }}
          />
        )}

        {isActive && [...Array(12)].map((_, i) => (
          <motion.div
            key={i}
            className="absolute w-4 h-4 bg-white/30 rounded-full"
            animate={{
              x: [0, (Math.random() - 0.5) * 200],
              y: [0, (Math.random() - 0.5) * 200],
              scale: [1, 0],
              opacity: [1, 0],
            }}
            transition={{
              duration: 1,
              repeat: Infinity,
              delay: i * 0.1,
            }}
            style={{
              left: '50%',
              top: '50%',
            }}
          />
        ))}

        <motion.span
          className="relative text-white font-bold text-lg z-10"
          animate={{
            scale: isActive ? [1, 1.2, 1] : 1,
          }}
          transition={{
            duration: 0.5,
            repeat: isActive ? Infinity : 0,
          }}
        >
          {isActive ? "CHAOS!" : "Unleash Chaos"}
        </motion.span>
      </motion.button>
    </div>
  );
};
